import React , { useState } from "react";
import {Carousel} from "react-bootstrap"
import display from "../Images/apple_shop.png";
import logo_img from "../Images/apple_logo.png";
import 'bootstrap/dist/css/bootstrap.min.css';

const MainBody = () => {
    let [index , setIndex] = useState(0);
    const handleSelect = (i) => {
        setIndex(i);
    }
  return (
      <>
      <Carousel activeIndex={index} onSelect={handleSelect}>
        <Carousel.Item key={1}>
          <Carousel.Caption>
            <img width={"300px"} src={logo_img} alt="logo"/>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item key={2}>
          <Carousel.Caption>
            <img width={"300px"} src={display} alt="display"/>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
      </>
  );
};

export default MainBody;
